import React from 'react';
import { useQueryClient } from 'react-query';
import { ITodo } from '../../../types/todo.types';
import { QUERY_KEYS } from '../../../consts/app-keys.const';
import { StyledMobileContainer } from './mobile.container.styled';
import TodoMobileElement from './todo-mobile-element.component';

const TodoMobileInner = () => {
  const queryClient = useQueryClient();
  const todos = queryClient.getQueryData<ITodo[]>(QUERY_KEYS.TODOS);

  return (
    <StyledMobileContainer>
      {todos?.map((todo) => (
        <TodoMobileElement todo={todo} />
      ))}
    </StyledMobileContainer>
  );
};

export default TodoMobileInner;
